package com.bridgelabz.basicprogram;

public class Swapnumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		 int x=10;
		 int y=20;
		 System.out.println("number"+x);
		 System.out.println("number"+y);
		 
		 
		 int temp=x;
		 
		 x=y;
		 y=temp;
		 
		 
		 System.out.println("number"+x);
		 System.out.println("number"+y);
	}


}
